import os
import random
import shutil
import uuid
import librosa

# set the path to the directory containing the folders
base_directory_path = "G:/studia_magisterskie/Projekt_badawczy/hinduski_dataset/Hindi_master/Hindi/RECS"

num_folders_to_choose = 5

# ustawienie liczby plików "pliki" do wybrania dla każdego wybranego folderu "foldery z id"
num_files_to_choose = 5

# pobranie listy wszystkich folderów "foldery z id"
id_folders = os.listdir(base_directory_path)

# wybieramy losowo num_folders_to_choose folderów "foldery z id"
#selected_id_folders = random.sample(id_folders, num_folders_to_choose)

# dla każdego wybranego folderu "foldery z id" wybieramy losowo num_files_to_choose plików "pliki"
selected_files = []
all_files = []
temp_files = []
count = 0
for folder in id_folders:
    folder_path = os.path.join(base_directory_path, folder)
    files = os.listdir(folder_path)
    files = [os.path.join(folder_path, f) for f in files]
    all_files.extend(files)
    random.shuffle(all_files)
    for file in all_files:
        audio_duration = librosa.get_duration(path=file)
        if audio_duration >= 5:
            temp_files.append(file)
            count += 1
            print(count)
        if count < 5:
            continue
        else:
            count = 0
            all_files = []
            break
    if len(temp_files)< 5:
        temp_files = []
        continue
    else:
        selected_files.extend(temp_files)
        temp_files = []
# wyświetlamy wybrane pliki
#print(selected_files)
destination_folder = 'C:/Users/Norbix/Desktop/studia/Projekt_badawczy/VoiceBiometrics/WAV2VEC2/testowanie_do_usunięcia'
os.makedirs(destination_folder, exist_ok=True)

# loop through the file paths and copy the files to the corresponding subfolder
for file_path in selected_files:
    # extract the id from the file path
    id_folder = os.path.basename(os.path.dirname(file_path))

    # construct the destination folder path for the id
    id_folder_path = os.path.join(destination_folder, id_folder)
    os.makedirs(id_folder_path, exist_ok=True)

    unique_name = str(uuid.uuid4())

    # construct the destination file path with the unique name
    destination_path = os.path.join(id_folder_path, unique_name + '.wav')

    # copy the file to the destination folder
    shutil.copy(file_path, destination_path)

# print a message when the files have been copied
print(f'{len(selected_files)} files copied to {destination_folder}.')
